          {
            "kind": "youtube#comment",
            "etag": "Vt39uxSmPYZwwsy2g7eBET32JSc",
            "id": "UgzzHl6sMyIsNhyLlvp4AaABAg.9OodqHpCSWH9PGRJM37nio",
            "snippet": {
              "channelId": "UCDwjiSF4qEb3aeT3ZLkPc_Q",
              "videoId": "hyaFextT6d4",
              "textDisplay": "@Ayyıldız Tim lo mismo me dicen los que me lo dictan ellos me dicen esto son como estrellas fugaces sobre cavernicolas que ni saben lo que son. lee esto .Porque todo líder social es un hipócrita o esta en camino de serlo.\r\nLa vida se había ensañado con Max, tenia problemas en todos los ángulos. Su mujer lo había abandonado supuestamente con un amigo porque también había desapareció sin dejar rastros. Quedando el a cargo de sus tres nenas, una minusválida. Sin motivos aparentes sus vecinos lo odiaban y le hacían magia negra. El decía que no le afectaba pero era obvio que si. Fue atacado por su propio perro que enloqueció y debió arrojarlo por el balcón, con la mala suerte de caer sobre otro perro y matarlo. Cosa que lo llevó a interminables pleitos legales con el dueño del perro que lo quería meter preso. El era docente en colegios secundarios, enseñaba filosofía, allí los problemas no cedían, primero la competencia desleal con sus colegas, luego los chismes y calumnias, infaltables en todo ámbito laboral, y la mala conducta de sus adolescentes era el primer remate del su lamentable vida. Que hasta parecía orquestada por un director maligno y sicópata para pagarle donde mas le doliera. (Y a lo mejor era asi...) Y eso era lo que le ocurría en el grado mas alto, en su intención de publicar su amadísimo y entrañable libro: Ética y Ontología para todos los días. El cual lo había escrito con el corazón en la mano, muy lejos de intereses mercantilistas, con la bondadosa intensión de darles armas y herramientas al vulgo para no corromperse con tanta facilidad. Escrito que ya llevaba tres años y medio tratando de publicar y el mundo editorial además de impenetrable se le mostraba muy mal educado, e hipócrita, porque publican los libros de altísimos valores, incluso de relaciones públicas, pero luego no son capaces de enviar un \"no, gracias\" por el envió del libro. \"...para ver la posibilidad de... \" Y asi fue como una madrugada de una noche de insomnio, el diablo ejecuto su jugada maestra. Max estaba bebiendo algún licor en el mismo balcón que asesino a su perro, con el suicidio como una nube molesta que se desvanecía por el amor de sus pequeñas hijas. El maligno había estado infiltrándose mas y mas en el sistema nervioso de Max, cosa que con cada ataque de ira de sus fracasos de su caotica vida hacia mejor, ya que al quebrarse el huevo áurico se introducía mas profundamente su oscuridad. Como un maligno hollín con vida propia. Y esa misma noche ya tenia el poder suficiente como para jugársela toda y ganar su alma. Comenzó metiéndose en el cuerpo emocional para inyectarle pensamientos-sentimientos como: “…pero a que humanidad quiero salvar y ayudar con mi libro, si el hombre es una porquería y no vale nada?... Dame un hombre que valga la pena!!! No tiene sentido mi empresa. Como el Quijote Estoy luchando contra nadie ayudando a nadie. Gastando inútilmente mi vida y mi energía, debería vivir para comer, beber drogarme, fornicar y dormir. Y lo peor de todo es que los adolescentes vienen peor que sus padres, toman los colegios para pedir aborto legal y gratuito.!!! Se drogan y beben en los recreos. Escuchan artistas satanistas. Hay un caos moral insalvable: drogas recreativas permitidas, casamiento de dos hombres y adopción igualitarias... Pornografía normalizada en cada sexshop. Sitios de Internet que ofrecen serle infiel a la pareja, los cual es faltar al juramento civil que se toma al casarse. \r\nNótese que era el mismos diablo quien le estaba enumerando sus logros, sus lobys, su propia agenda con la cual hace enfrentar al hombre contra Dios para tener licencia para a destruirlo. Imperdonable y sucia hipocresía!!! \"El mundo no es digno de mi libro, de mi luz, de mi amor, de mi ayuda.\", Esa oración ya la dijo solo, sin la influencia demoníaca. Los ángeles, por supuesto lo registraban. Maldijo el día que nació, maldijo la humanidad, maldijo su libro, maldijo el bien, a Dios y a su obra: la vida de los hombres y odio a Jesús profundamente, por salvar pecadores que no sirven para nada. Porque \"los valores es lo único que determina nuestro verdadero valor\". Para que hiciste eso Jesús? Para prologar este martirio del universo llamado \"hombres\"!!!. \r\nCon una siniestra sincronía llego el diario que el distribuidor arrojaba a su balcón, por supuesto le pego en la cabeza y tumbo una maseta y como ni lo vio, nunca lo saludo nile pidió perdón. Y cual era la bomba del día? \"El presidente preso\" por la confirmación de innumerables denuncias de corrupción. Esa mañana era la versión estrangulada y moderna de Job, pero este, un Job fallido. Hizo café, se ducho sin dejar de maldecir, nunca salio de su trance de odio, con lo cual facilitaba que la oscuridad, se metiera con mas agudeza para la propia desgracia de este aspirante de salvador de la humanidad. Y esta rabia ya se reflejaba en su rostro con un nuevo aspecto horrible. Pelo electrizado, mirada rojiza y vidriosa hasta su dentadura parecía mas grande. Y a lo mejor lo era para una medición nanométrica. Y justo a las seis, numero con injustificada mala reputación, sonó el celular, era una dulce y cálida voz de una mujer joven que primeramente se disculpo elegantemente por la hora, pero no pudo evitar hacer el llamado, ella era Clarisa Lopez, la directora de la editorial  Índigo y acaba de terminar de leer la obra de Max, la cual la había conmovido profundamente enviándole su mas profunda felicitaciones, hermanadonse tácitamente en el bien social. Max no salía de su asombro y no oculto su felicidad, ella lo cito para ese mismo día para una reunión para su inmediata publicación. Max eufórico accedió. Ni bien colgó el diablo dijo fingiendo ser el: Acabo de maldecirlo todo y voy a publicarlo? Si, lo haré por dinero, será mi secreta venganza de este maldito y maligno mundo. Que no es digno de mi libro\". \r\nJesús por su parte, como una onda, le envió el sentimiento de arrepentimiento de todo lo que dijo, era todo lo que tenia que hacer para romper el hechizo del diablo, pero no accedió en lo mas mínimo. La oscuridad, luego de un trabajo de seis horas, triunfo lamentablemente. Los ángeles se retiraron, se retiro el diablo pronunciando : Bienvenido al club, y Max casi que lo escuchó. Congenió muy bien con Clarisa se pudieron de acuerdo en seguida y el libro fue un bestsellers de la noche a la mañana, se público en muchos países donde fue invitado a dar conferencias. Para explicar: \r\n-Porque no ponerse en \"objeto\" en el ámbito laboral siendo \"sujetos\" con moral. \r\n-Porque todo se trata que el espíritu y su razones triunfen sobre el cuerpo y sus pasiones. \r\n-También porque todo se simplificar entre elegir un bien momentáneo con un supuesto mal futuro, o, un sacrificio momentáneo por un eterno premio futuro. \r\n-Y todo concluía con sus argumentos en contra de la pornografía, las drogas, la ideología de género, el aborto. La corrupción en general.\r\nDiscursos en los cuales muchas veces citaba la biblia…\r\nMuchos años después le ocurrió el siguiente episodio en una conferencia. Un joven despeinado y algo tartamudo se le acerco para que le firmara el libro y el diablo le susurro en su oído como ya había compensado hacer: Este es uno de los pocos que no puedo atrapar de ninguna manera como te atrape a ti. \r\nMax lo odio intensamente y se lo hizo saber con una mirada oscura y escribiendo en su libro con letra ilegible, angulosa e improlija. Pasando así Max a otro nivel mas profundo de su consagración al mal, pero ni aun asi condenado definitivamente cosa que solo ocurre con la muerte. Este es un cuento perfecto para que en vez de terminar con la palabra \"fin\" termine con la palabra que Jesús comenzó todo: Arrepentios.\r\n--------------------------------------------------------------------------------------------------------------------------------------------- \r\n\r\naqui al final una acotacin muy importante https://armasluminosas.blogspot.com/2021/07/gggla-vida-se-habia-ensanado-con-max.html",
